import { Squash as Hamburger } from "hamburger-react";

const show = document.getElementById("filter-dropdown").cla;

const Menubutton = () => {
  <div id="menu-button">
    <Hamburger
      rounded
      size={24}
      onToggle={(toggled) => {
        (toggled && show.classList.remove("invisible"))(
          !toggled && show.classList.add("invisible")
        );
      }}
    />
  </div>;
};

export default Menubutton;
